    esBind(GL_ELEMENT_ARRAY_BUFFER, &esModelArray[esModelArray_index].iid, h20_indices, sizeof(h20_indices), GL_STATIC_DRAW);
    esModelArray[esModelArray_index].itp = GL_UNSIGNED_SHORT;
    esModelArray[esModelArray_index].ni = h20_numind;
    esModelArray[esModelArray_index].nv = h20_numvert;
